(129, 'Backpanel bouwen ', '', 960, 2, 2, 'Back-panel = 16 uur\r\nOm een goed inzicht te krijgen van de orders, lopende zaken en als ondersteuning van de helmdesk van Lediberg moeten de volgende zaken gemaakt worden:\r\n1 - Inlog voor Lediberg\r\n2 - Orderoverzicht, hierin staat de status van een order + klant gegevens\r\n3 - Order info, hierin kun je het ontwerp terug zien\r\n4 - Standaard e-mail communicatie in Lediberg stijl\r\n\r\nHelpdesk. Ik heb begrepen dat Lediberg zelf de helpdesk gaat runnen. Telefonisch contact is een must dus graag horen wij nog welk nummer er als Helpdesk nummer ingesteld kan worden. Ook graag een e-mail adres aanmaken (bijvoorbeeld: helpdesk@lediberg.nl).\r\n ', '14-3-2016 Backpanel bouwen\n15-3-2016 Graveren punten', 27, 77, 1, 2, NULL),
(131, 'Facturering', '', 480, 2, 2, 'De betaling loopt via Digitransfer. 1 maandelijks moet er een soort maand overzicht verzonden worden richting Lediberg met daarin een totaal bedrag + een specificatie van alle gemaakte orders. Wat maken wij:\r\n1 - Betaal koppeling vanuit site richting Digi\r\n2 - Maandelijks wordt er een PDF gegenereerd en naar leiberg en digi gestuurd met hierin een eind bedrag waarvan Lediberg een factuur richting Digitransfer kan sturen\r\n3 - Order overzicht wordt ook in Digi back-panel geplaatst zoals nu ook bij Heineken waarin de kosten als verdiensten inzichtelijk zijn', '', 27, 77, 1, 2, NULL),
(132, 'Homepage blokken bewerkbaar maken / automatisch schalen afbeeldingen', '', 45, 2, 2, 'Homepage blokken bewerkbaar maken / automatisch schalen afbeeldingen', '17-2-2016 kleine aanpassingen homepage en automatisch schalen afbeeldingen', 28, 78, 1, 2, NULL),
