(139, 'Kleine front-end punten fixen', '', 180, 2, 2, 'Homepage:\r\n\r\nTucson boek\r\n- Vanaf € 14,95 incl. indruk\r\n\r\nBlack Color boek\r\n- Vanaf € 15,95 incl. indruk\r\n\r\nContrast boek\r\n- Vanaf € 17,95 incl. indruk\r\n- Beschikbaar in 4 kleuren en 2 maten\r\n\r\nKies je artikel:\r\n- Geen rood bij Tucson\r\n- Bij Contrast 4 kleuren: blauw/oranje/roze/fluorgroen, de rest niet\r\n- Bij Black Color 4 kleuren: blauw/oranje/roze/fluorgroen, de rest niet\r\n- Prijzen:  zie bijgaand prijsblad\r\n- Indeling: alleen gelinieerd \r\n\r\nPersonaliseer artikel:\r\n- Positie 2 gecentreerd in het midden van het boek\r\n- Lettertypes en corpsgrootte, dit werkt bij mij niet echt lekker maar wellicht ligt dat aan mij…. SAFARI???\r\n- Bij tekst verticaal naast elastiek staat het resultaat te dicht op de rand\r\n- Visual zodanig dat het ton-sur-ton is (zie foto).\r\n- Corps grote auto aanpassen (kleiner maken) als je naar positie 3 gaat en het past niet in het vak\r\n\r\nWinkelmandje:\r\n- Leveringsvoorwaarden: zijn nu die van Digitransfer, er volgt een nieuwe tekst, krijg je woensdag a.s.\r\n- Op factuur weg\r\n- MisterCash toevoegen\r\n\r\nMailtjes:\r\n- Social buttons weg\r\n- de 3 soorten mails als test naar Ruud mailen voor de tekst', '', 27, 77, 1, 2, NULL),
(141, 'Fax bericht ontwerpen', '', 45, 1, 3, 'Kun je een FAX A4 maken van een 3 tal (zout) strooiers die we op voorraad hebben:\r\n \r\nEarthway 2170 € 185,- ex\r\nEarthway 2130 € 173,- ex\r\n2040 PL 78,- ex\r\n \r\nDe gebruikte merknaam (EARTHWAY) is heel belangrijk, mensen gaan daar op googelen en zullen zien dat het ècht niet voordeliger kan..\r\n \r\nGraag creatief dingetje; lekker schreeuwerig, nu kopen = de aller allerscherpste inkoop ooit.\r\n \r\nPrijzen zijn per stuk, GELEVERD, in Nederland. Het is als winterjassen in de zomer kopen zeg maar.\r\n \r\nKun je er bij zetten dat de 1e 25 bestellers krijgen gratis een ALPIN Metal sneeuwschuif er bij geleverd.', '', 20160031, 83, 1, 3, NULL),
