(737, 'SEO techniek update', '', 480, 2, 2, 'Hieronder een advies van Danny wat we zouden kunnen verbeteren als we het echt over SEO zouden hebben voor de website. De opdracht was natuurlijk om de huidige website te vervangen voor een nieuwe website op basis van de bestaande content. Er zijn dus bepaalde werkzaamheden niet uitgevoerd.\r\n \r\nHomepage  (mixfinity / klant)\r\nIk zie dat de homepage van-amerongen.com nu wordt geredirect naar .com/nl. Is dit bewust zo gedaan? \r\nIk zou de homepage namelijk nooit redirecten. Veruit de meeste linkwaarde zit op de homepage. \r\nMaar goed, wellicht dat hier vanuit Van Amerongen bewust voor gekozen is, om de NL taal te tonen op een .com adres? Het is beter om op een .com adres engelse taal te hebben. Dit houdt wel in dat iedereen dus eerst Engels als taal krijgt als men van-amerongen.com in de browser intoetst.\r\n \r\nAlternate hreflang (mixfinity)\r\nZou je bij de alternate hreflang tag ook de pagina waarop je jezelf bevind willen toevoegen? \r\n \r\nDus bij de pagina https://www.van-amerongen.com/nl/ca-ulo ook de hreflang tag aanmaken voor de Nederlandse URL. Verder ziet het er prima uit! \r\n \r\n<link rel="alternate" href="http://www.van-amerongen.com/de/ca-ulo" hreflang="de" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/en/ca-ulo" hreflang="en" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/es/ca-ulo" hreflang="es" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/fr/ca-ulo" hreflang="fr" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/tr/ca-ulo" hreflang="tr" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/pt/ca-ulo" hreflang="pt" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/ru/ca-ulo" hreflang="ru" />\r\n<link rel="alternate" href="http://www.van-amerongen.com/pl/ca-ulo" hreflang="pl" />\r\n \r\nSnelheid  (mixfinity)\r\nZodra er echt iets met vindbaarheid gedaan moet worden zou de snelheid ook verbeterd moeten worden (vooral de afbeeldingen zijn groot en daar is een grote slag te slaan). Als ik het kan inschatten is dit nu nog niet aan de orde?\r\n \r\n \r\nMeta title  (klant)\r\nVeel pagina’s hebben nog dezelfde title tag. Het zou beter zijn wanneer er voor iedere pagina een unieke title tag is. Kan dit bijvoorbeeld op basis van de paginanaam automatisch gebeuren? \r\nBij de pagina https://www.van-amerongen.com/nl/apple-storage is dit bijvoorbeeld ‘appels bewaren’. Als de title tag dan automatisch ‘Appels bewaren | Van Amerongen’ kan worden dan is iedere pagina in ieder geval voorzien van een unieke title tag. \r\n \r\n<image001.png>\r\n \r\nMeta descriptions  (klant)\r\nBij geen enkele pagina is er een meta description ingevuld. Ik zou de klant adviseren om dit te doen. (Moet nog in CMS worden geplaatst)\r\n \r\n \r\n ', '3-4-2017 SEO verbeteren', 20160362, 535, 1, 2, NULL),
